import React from 'react';
import './App.css';

import posts from './api/posts';
import comments from './api/comments';
import users from './api/users';

function PostList (props) {
  const postItems = props.posts.map((post) => {
    const comentslist = props.comments.find(comment => comment.id === post.id);

    return (
      <tr key={post.id}>
        <td>{post.title}</td>
      </tr>
    )
  });

  const App = () => (
    <div className="App">
      <h1>Static list of posts</h1>

      <p>
        <span>posts: </span>
        {posts.length}
      </p>

      <p>
        <span>comments: </span>
        {comments.length}
      </p>

      <p>
        <span>Users: </span>
        {users.length}
      </p>
    </div>
  );
};

export default App;
